{"formula":"IF(
  MIN(
    ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
    IF({status} = "3 months", 1,
      IF({status} = "6 months", 2,
        IF({status} = "12 months", 4, 99)
      )
    )
  ) * 8 = 0,
  "",
  
  IF(
    {lookup_mktkzrt} / (
      MIN(
        ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
        IF({status} = "3 months", 1,
          IF({status} = "6 months", 2,
            IF({status} = "12 months", 4, 99)
          )
        )
      ) * 8
    ) < 0.5,
    "High Priority | " & ROUND(
      {lookup_mktkzrt} / (
        MIN(
          ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
          IF({status} = "3 months", 1,
            IF({status} = "6 months", 2,
              IF({status} = "12 months", 4, 99)
            )
          )
        ) * 8
      ) * 100, 1
    ) & "% of expected",
    
    IF(
      {lookup_mktkzrt} / (
        MIN(
          ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
          IF({status} = "3 months", 1,
            IF({status} = "6 months", 2,
              IF({status} = "12 months", 4, 99)
            )
          )
        ) * 8
      ) < 0.85,
      "Medium Priority | " & ROUND(
        {lookup_mktkzrt} / (
          MIN(
            ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
            IF({status} = "3 months", 1,
              IF({status} = "6 months", 2,
                IF({status} = "12 months", 4, 99)
              )
            )
          ) * 8
        ) * 100, 1
      ) & "% of expected",
      
      IF(
        {lookup_mktkzrt} / (
          MIN(
            ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
            IF({status} = "3 months", 1,
              IF({status} = "6 months", 2,
                IF({status} = "12 months", 4, 99)
              )
            )
          ) * 8
        ) <= 1.1,
        "On Track | " & ROUND(
          {lookup_mktkzrt} / (
            MIN(
              ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
              IF({status} = "3 months", 1,
                IF({status} = "6 months", 2,
                  IF({status} = "12 months", 4, 99)
                )
              )
            ) * 8
          ) * 100, 1
        ) & "% of expected",
        
        "Overachieving | " & ROUND(
          {lookup_mktkzrt} / (
            MIN(
              ROUNDUP(DAYS(TODAY(), {date4}) / 90, 0),
              IF({status} = "3 months", 1,
                IF({status} = "6 months", 2,
                  IF({status} = "12 months", 4, 99)
                )
              )
            ) * 8
          ) * 100, 1
        ) & "% of expected"
      )
    )
  )
)
"}
